import React from "react";
import Header from "./Header";
import TreeSection from "./Tree/TreeSection";
import TreeLink from "./Tree/TreeLink";

function Container() {
	return (
		<div className="sidebar">
			<Header />
			<TreeSection>
				<TreeLink id="s" />
			</TreeSection>
		</div>
	);
}

export default Container;
